//RemoveDsStore will return a base64 encoded zipFile string with all .DS_Store and __MACOSX files removed
func RemoveDsStore(zipBase64 string) (string, error) {
	//Decode the zipBase64 string to a []byte
	zipBytes, err := base64.StdEncoding.DecodeString(zipBase64)
	if err != nil {
		return "", err
	}

	//Create a file from the zip []byte
	zipFile, err := ioutil.TempFile("", "zippy-zipper*.zip")
	if err != nil {
		return "", err
	}
	defer zipFile.Close()

	_, err = zipFile.Write(zipBytes)
	if err != nil {
		return "", err
	}

	_, err = Unzip(zipFile.Name(), "output-file")
	if err != nil {
		return "", err
	}

	cdCmd := exec.Command("bash", "-c", "cd output-file; zip -r output-file.zip *;")
	err = cdCmd.Run()
	if err != nil {
		return "", err
	}

	zipRemovedBytes, err := ioutil.ReadFile(os.TempDir() + "output-file/output-file.zip")
	if err != nil {
		return "", err
	}

	zipRemovedBase64 := base64.StdEncoding.EncodeToString(zipRemovedBytes)

	os.RemoveAll(zipFile.Name())
	os.RemoveAll(os.TempDir() + "output-file")

	return zipRemovedBase64, nil
}

func Unzip(src string, dest string) ([]string, error) {

	var filenames []string

	r, err := zip.OpenReader(src)
	if err != nil {
		return filenames, err
	}
	defer r.Close()

	for _, f := range r.File {

		if f.Name[:8] == "__MACOSX" {
			continue
		}

		extensionIndex := strings.LastIndex(f.Name, ".")
		extension := f.Name[extensionIndex+1:]
		if extension == "DS_Store" {
			continue
		}

		if f.FileInfo().IsDir() {
			continue
		}

		indexForwardSlash := strings.Index(f.Name, "/")
		// Store filename/path for returning and using later on
		fpath := filepath.Join(dest, f.Name[indexForwardSlash+1:])

		// Check for ZipSlip. More Info: http://bit.ly/2MsjAWE
		if !strings.HasPrefix(fpath, filepath.Clean(dest)+string(os.PathSeparator)) {
			return filenames, fmt.Errorf("%s: illegal file path", fpath)
		}

		fpath = os.TempDir() + fpath

		filenames = append(filenames, fpath)

		fmt.Println("PATH PATH", fpath)

		if f.FileInfo().IsDir() {
			// Make Folder
			os.MkdirAll(fpath, os.ModePerm)
			continue
		}

		// Make File
		if err = os.MkdirAll(filepath.Dir(fpath), os.ModePerm); err != nil {
			return filenames, err
		}

		outFile, err := os.OpenFile(fpath, os.O_WRONLY|os.O_CREATE|os.O_TRUNC, f.Mode())
		if err != nil {
			return filenames, err
		}

		rc, err := f.Open()
		if err != nil {
			return filenames, err
		}

		_, err = io.Copy(outFile, rc)

		// Close the file without defer to close before next iteration of loop
		outFile.Close()
		rc.Close()

		if err != nil {
			return filenames, err
		}
	}
	return filenames, nil
}
